import React from 'react';
import './style.css';

function Container(props) {
    let name = props.name;
    console.log(props);
        return (
                <div
                role="img"
                className="click-item"
                name={props.name }
                onClick={() => this.props.handleClickEvent(name)}
                style={{ backgroundImage: "url(" + props.src + ")" }}>
            </div>
        )
}
export default Container;
